import React from "react";

import NIGHT from "../../assets/BOG1.jpg";
import BLUEGRADIENT from "../../assets/BLUE.png";
import GUITAR from "../../assets/Guitar.png"
import XBOX from "../../assets/XBOX.png"
import Menu from "../Menu/Menu";

export default class Hobbies extends React.Component {
  render() {
    return (
      <div className="ContextContainer">
        <Menu />
        <div style={{ height: "2vh" }}>&nbsp;</div>

        {/* ---------- */}
        {/* CONTENT */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + NIGHT + ")" }}
            data-uk-parallax="bgy: 150"
          >
            <h1 data-uk-parallax="y: -200; easing: 0.5" id="CardName">
              hobbies
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P01 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(https://images.pexels.com/photos/811838/pexels-photo-811838.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260)" }}
            data-uk-parallax="bgy: 150"
          >
            <h1
              data-uk-parallax="y: -1; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              01
            </h1>
            <img src={GUITAR} alt="Electric Guitar" width="600px" style={{position: 'relative', right: '-20em'}} data-uk-parallax="y: -150; easing: 0"/>
          </div>
        </div>

        {/* ---------- */}
        {/* P02 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(https://images.pexels.com/photos/1670977/pexels-photo-1670977.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260)" }}
            data-uk-parallax="bgy: 150"
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              02
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P03 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              03 - gaming
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P04 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + BLUEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              03 -languages
            </h1>
          </div>
        </div>

        <div style={{ height: "10vh" }}>&nbsp;</div>
      </div>
    );
  }
}
